import classes from "./Dialogs.module.css";
import {NavLink} from "react-router-dom";

type DialogItemTypeProps = {
    name: string
    id: string
}

const DialogItem = (props: DialogItemTypeProps) => {
    let path = "/dialogs/" + props.id
    return (
        <div className={classes.dialog + " " + classes.active}>
            <NavLink to={path}>{props.name}</NavLink>
        </div>
    )
}

type MessageTypeProps = {}
message: string

const Message = (props: MessageTypeProps) => {
    return (
        <div className={classes.dialog}>{props.message}</div>
    )
}


export const Dialogs = () => {
    return (
        <div className={classes.dialogs}>
            <div className={classes.dialogsItems}>
                <DialogItem name='Alex'
                            id='1'
                />
                <DialogItem name='Vasile'
                            id='2'
                />
                <DialogItem name='Michael'
                            id='3'
                />
                <DialogItem name='Gabriella'
                            id='4'
                />
                <DialogItem name='Any'
                            id='5'
                />
            </div>
            <div className={classes.messages}>

                <div className={classes.dialog}>Thank you</div>
                <div className={classes.dialog}>Why</div>
            </div>
        </div>
    )
}
